class Solution:
    def minSizeSubarray(self, nums: List[int], target: int) -> int:
        prefix_sum = [0]
        for num in nums:
            prefix_sum.append(prefix_sum[-1] + num)

        if prefix_sum[-1] == 0: return -1

        total_sum = prefix_sum[-1]
        min_length = float('inf')

        if total_sum >= target:
            for i in range(len(nums)):
                for j in range(i + 1, len(prefix_sum)):
                    if prefix_sum[j] - prefix_sum[i] >= target:
                        min_length = min(min_length, j - i)
                        break

        if total_sum < target:
            rounds = target // total_sum
            remain_target = target % total_sum
            if remain_target == 0:
                min_length = rounds * len(nums)
            else:
                for i in range(len(nums)):
                    for j in range(i + 1, len(prefix_sum)):
                        if prefix_sum[j] - prefix_sum[i] + rounds * total_sum >= target:
                            min_length = min(min_length, j - i + rounds * len(nums))
                            break

        return min_length if min_length != float('inf') else -1
